import { extendObservable } from "mobx";
import { decorate, observable, computed } from "mobx";

class GameStore {
  constructor() {
    extendObservable(this, {
      gameState: "office",
      score: 0,
      decisions: {
        gpsText: false,
        datenhinterlegungText: false,
        keintrackingText: false,
        neinkksText: false,
        jakksText: false,
        neinkonzerneText: false,
        jakonzerneText: false,
        neinreiseText: false,
        jareiseText: false,
        neinkamerasText: false,
        jakamerasText: false,
        jagesichtserkennungText: false,
        jawaermebildText: false,
      },
    });
  }

  setGameState(value) {
    this.gameState = value;
  }

  get getDecisionsAmount() {
    let count = 0;
    for (var prop in this.decisions) {
      if (Object.prototype.hasOwnProperty.call(this.decisions, prop)) {
        if (prop === true) {
          count++;
          console.log("Test");
        }
      }
    }
    Object.keys(this.decisions).forEach(function (key, index) {
      count++;
    });
    return count;
  }
}
decorate(GameStore, {
  getDecisionsAmount: computed,
});
export default GameStore;
